import {
  createBrowserRouter,
  createRoutesFromElements,
  RouterProvider,
  BrowserRouter as Router,
  Routes,
  Route
} from 'react-router-dom'








function App() {
  return (
    <Router>
      <Routes>
        <Route>
          <Route path='/'  element={<h1>Hello world</h1>}/>
        </Route>
      </Routes>
    </Router>
  );
}

export default App;
